import React from 'react';
import { TextField, Container, Typography, makeStyles } from '@material-ui/core';

const reminderStyle = makeStyles({
    textfield: {
        position: "absolute",
        marginTop: "10px",

    }
})

function CreateReminder() {
    const classes = reminderStyle();

    return (
        <Container>
            <Typography variant="h4">
                Heading
            </Typography>
            <Typography variant="h6">
                Creat a reminder
            </Typography>

            <form 
            noValidate 
            >
                <TextField 
                label="Reminder"
                variant="outlined"
                color="secondary"
                className={classes.textfield}
                />
            </form>
        </Container>
    )
}

export default CreateReminder
